import com.eviware.soapui.support.XmlHolder

def response =context.testCase.getTestStepByName('CreateCustomer').getPropertyValue("Response")
def holder =new XmlHolder(response)
def customerid =holder.getNodeValue("//*:id")
def AddressId =holder.getNodeValue("//item//*:id")
log.info "Customer Id = " +customerid
log.info "Address Id = " + AddressId
//this is basically to store my response node element in the property of my test case
context.testCase.testSuite.setPropertyValue("customerid",customerid)
//log.info context.expand('${#TestCase#customerid}')
context.testCase.testSuite.setPropertyValue("AddressId",AddressId)

